import React from 'react';
import { InputGroup, FormControl, Button } from 'react-bootstrap';
import PropTypes from 'prop-types';
import DisplayErrors from '../DisplayErrors';

const AddEditAssetTypesForm = props => {
  return (
    <div className="card-text text-left add-edit-user">
      <div className="">
        <form onSubmit={props.handleSubmit}>
          <DisplayErrors errors={props.formErrors} />
          <div className="row">
            <div className="col col-lg-4 col-12">
              <InputGroup size="sm">
                <FormControl
                  type="text"
                  placeholder="Asset Type"
                  id={props.assetTypeFieldId}
                  value={props.assetTypeFieldValue}
                  name={props.assetTypeFieldId}
                  onChange={props.handleChange}
                />
              </InputGroup>
            </div>
          </div>
          <div className="row">
            <div className="col col-lg-4 col-12">
              <InputGroup size="sm">
                <FormControl
                  type="text"
                  placeholder="Color"
                  id={props.colorFieldId}
                  value={props.colorFieldValue}
                  name={props.colorFieldId}
                  onChange={props.handleChange}
                />
              </InputGroup>
            </div>
          </div>
          <div className="row">
            <div className="col col-lg-4 col-12">
              <InputGroup size="sm">
                <FormControl
                  type="text"
                  placeholder="attribute"
                  id={props.attributeFieldId}
                  value={props.attributeFieldValue}
                  name={props.attributeFieldId}
                  onChange={props.handleChange}
                />
              </InputGroup>
            </div>
          </div>
          <div className="row">
            <div className="col col-lg-4 col-12">
              <InputGroup size="sm">
                <FormControl
                  type="text"
                  placeholder="Days to process"
                  id={props.daysFieldId}
                  value={props.daysFieldValue}
                  name={props.daysFieldId}
                  onChange={props.handleChange}
                />
              </InputGroup>
            </div>
          </div>
          <div className="row">
            <div className="col col-lg-4 col-12">
              <InputGroup size="sm">
                <FormControl
                  type="text"
                  placeholder="Organization"
                  id={props.organizationFieldId}
                  value={props.organizationFieldValue}
                  name={props.organizationFieldId}
                  onChange={props.handleChange}
                />
              </InputGroup>
            </div>
          </div>
          <Button
            type="submit"
            className="btn onboarding-btn"
            disabled={props.disabled}
          >
            Submit
          </Button>
        </form>
      </div>
    </div>
  );
};

AddEditAssetTypesForm.propTypes = {
  handleSubmit: PropTypes.func.isRequired,
  formErrors: PropTypes.object.isRequired,
  handleChange: PropTypes.func.isRequired,
  disabled: PropTypes.bool.isRequired,
  organizationFieldValue: PropTypes.string.isRequired,
  organizationFieldId: PropTypes.string.isRequired,
  assetTypeFieldId: PropTypes.string.isRequired,
  assetTypeFieldValue: PropTypes.string.isRequired,
  colorFieldId: PropTypes.string.isRequired,
  colorFieldValue: PropTypes.string.isRequired,
  attributeFieldId: PropTypes.string.isRequired,
  attributeFieldValue: PropTypes.array.isRequired,
  daysFieldId: PropTypes.string.isRequired,
  daysFieldValue: PropTypes.number.isRequired
};

AddEditAssetTypesForm.defaultProps = {};

export default AddEditAssetTypesForm;
